Storyline:

    An Indian Agent (Murphy) is sent to try a new approach to peace with the Apaches, based on respect for automomy rather than submission to Army. He wins over the reservation chiefs and the Indian widow (Bancroft), who was given to him as housekeeper. Through use of diplomacy and demonstrations of faith in Apache leaders, the reservation is put on the road to automomy. Conflicts arise between the Apache widow and his Eastern wife, but latter has a lot to learn about life on the frontier.



